    (1, '/assets/customer/img/hero/banner1.png', 'Bộ sưu tập Thu-Đông 2030', 'Một nhãn hiệu chuyên tạo ra những sản phẩm thiết yếu sang trọng. Được tạo ra một cách có đạo đức với một thái độ kiên định\n cam kết chất lượng vượt trội.', '/assets/customer/img/hero/banner2.png', 'Bộ sưu tập Xuân-Hạ 2030', 'Một nhãn hiệu chuyên tạo ra những sản phẩm thiết yếu sang trọng. Được tạo ra một cách có đạo đức với một thái độ kiên định\n cam kết chất lượng vượt trội.', NULL, 'Bộ sưu tập giày 2030', NULL, 'Giày Xuân 2030', NULL, 'Phụ kiện', NULL, 'Giày thể thao đơn giản', '2024-05-10 22:59:22');
INSERT INTO `san_pham` (`id`, `id_thuong_hieu`, `id_the_loai`, `ten`, `ngay_tao`, `ngay_sua`, `nguoi_tao`, `nguoi_sua`, `trang_thai`, `mo_ta`) VALUES
                                                                                                                                                   (1, 1, 1, 'Chuck 70 AT-CX', '2024-02-05 02:13:26', '2024-04-17 08:04:58', NULL, NULL, b'1', '<h2>CHUCK 70 AT-CX PLATFORM - PRODUCT DETAILS</h2><p>NEXT-LEVEL TRAILBLAZER</p><p>The Chuck 70 AT-CX takes the best-ever design you know and love to new heights, with new purpose. Made for outdoor runners, the Chuck 70 AT-CX merges performance and comfort features to help you cover more ground than ever. A higher, platform midsole and CX foam cushioning provide all-day comfort wherever your route takes you. The silhouette maintains the classic Chuck 70 look, while a durable Bosey toe and rugged, new traction outsole encourage you to explore daringly, without leaving style in the dust.</p><p>Features And Benefits</p><p>High-top platform with cotton canvas upper</p><p>CX foam cushioning for all-day comfort</p><p>Bosey toe for added durability</p><p>Diamond lugged outsole for added grip</p><p>Classic Chuck 70 details: Debossed vintage star ankle p</p>'),
                                                                                                                                                   (3, 1, 1, 'Air Jordan 1 Low', '2024-02-05 08:20:00', '2024-02-29 15:01:01', NULL, NULL, b'1', '<p><strong>Tổng quan:</strong></p><ul><li>Phiên bản Air Jordan 1 cổ thấp dành riêng cho chơi golf với thiết kế lấy cảm hứng từ quốc kỳ Hoa Kỳ.</li><li>Phối màu “USA” nổi bật với gam màu đỏ,&nbsp;trắng và xanh dương.</li><li>Chất liệu cao cấp mang lại sự thoải mái và độ bền cao.</li></ul><p><strong>Đặc điểm:</strong></p><ul><li>Phần trên bằng da tổng hợp cao cấp,&nbsp;chống thấm nước.</li><li>Logo Swoosh màu trắng được thêu tỉ mỉ trên hai bên thân giày.</li><li>Logo Jumpman dập nổi trên lưỡi gà và gót giày.</li><li>Lớp lót bằng vải dệt mềm mại,&nbsp;thoáng khí.</li><li>Đế giữa bằng Phylon cho khả năng đệm êm ái.</li><li>Đế ngoài cao su với thiết kế đặc biệt dành cho chơi golf,&nbsp;tăng cường độ bám và chống trượt.</li></ul><h3>Thông tin sản phẩm Giày Air Jordan 1 Low Golf ‘USA’</h3><p><strong>Thương hiệu:</strong><span style="color: rgb(40, 40, 40);">Air Jordan&nbsp;</span></p><p><br></p>'),
                                                                                                                                                   (4, 3, 2, 'Jordan Max Aura 5', '2024-02-05 13:46:48', '2024-04-12 03:01:53', NULL, NULL, b'1', '<p>sdfsdfs</p>'),
                                                                                                                                                   (5, 3, 1, 'Nike Full Force Low White', '2024-02-13 08:11:07', '2024-03-06 08:07:56', NULL, NULL, b'1', '<p>A new shoe with old-school appeal—your retro dreams just came true. This pared-back design references the classic AF-1, then leans into \'80s style with throwback stitching and varsity-inspired colours. Not everything has to be a throwback, though—modern comfort and durability make them easy to wear any time, anywhere. Time to throw them on and go full force.</p><ul><li>Colour Shown: White/Black/Sail/University Gold</li><li>Style: FB1362-103</li></ul><p><br></p>'),
	(6, 4, 1, 'Vans Style 36 “Marshmallow” Dress Blue', '2024-02-14 07:53:12', '2024-03-07 13:23:17', NULL, NULL, b'1', '<p>Vans Style 36 "Marshmallow" Dress Blue</p><p>Màu sắc: Trắng ngà</p><p>Giới tính: Men/Women</p><p>Chất liệu: Da lộn mix vải canvas</p><p>Phụ kiện đi kèm: Box, túi vải</p><p>Chế độ bảo hành: Không hỗ trợ bảo hành với sản phầm order nước ngoài</p><p>Đặt hàng trực tiếp trên website hoặc liên hệ LightBee để được tư vấn và sở hữu ngay sản phẩm<a href="https://www.wear.com.vn/all-shoes-vans" rel="noopener noreferrer" target="_blank" style="color: rgb(87, 84, 84);">&nbsp;giày Vans chính hãng</a>&nbsp;&nbsp;này bạn nhé!</p><p>Nguồn:&nbsp;<a href="https://www.wear.com.vn/" rel="noopener noreferrer" target="_blank" style="color: rgb(87, 84, 84);">https://www.wear.com.vn/</a></p>'),
	(9, 3, 2, 'Luka 2', '2024-02-19 07:20:48', '2024-02-20 14:42:11', NULL, NULL, b'1', '<p><strong>Đặc điểm nổi bật:</strong></p><ul><li><strong>Màu sắc cổ điển:</strong>&nbsp;Thân giày màu kem sữa kết hợp với các điểm nhấn màu đen tạo nên vẻ ngoài thanh lịch và sang trọng.</li><li><strong>Chất liệu bền bỉ:</strong>&nbsp;Mặt lưới dệt thoáng khí đảm bảo sự thoải mái trong khi chơi bóng, lớp phủ overlays gia cố hỗ trợ tăng cường độ bền.</li><li><strong>Hỗ trợ tối ưu:</strong>&nbsp;Đế giữa được trang bị công nghệ Zoom Air Strobel, mang lại khả năng đàn hồi và giảm chấn vượt trội.</li><li><strong>Kiểu dáng thanh thoát:</strong>&nbsp;Kiểu dáng thanh thoát, ôm vừa vặn giúp bạn di chuyển linh hoạt và thoải mái.</li><li><strong>Độ bám tốt:</strong>&nbsp;Đế giày bằng cao su bền bỉ với các rãnh dọc cho độ bám tốt trên nhiều bề mặt khác nhau.</li></ul><p><strong>Giày Bóng rổ Nike Jordan Luka 2 PF Doncic ‘Coconut Milk’ DX9012-100 là lựa chọn hoàn hảo cho:</strong></p><ul><li>Các cầu thủ bóng rổ chuyên nghiệp, những người tìm kiếm một đôi giày mang lại hiệu suất tối ưu.</li><li>Những'),
	(13, 3, 2, 'Giày Sneaker Trẻ Em Nike Revolution 7', '2024-02-20 06:37:14', '2024-03-16 14:40:24', NULL, NULL, b'1', '<p>ưefdsdf</p>'),
	(14, 1, 5, 'Men\'s Golf Shoes', '2024-02-20 12:54:22', '2024-02-20 14:36:34', NULL, NULL, b'1', '<p><span style="color: rgb(85, 85, 85);">Bộ sưu tập giày chơi golf&nbsp;</span><strong style="color: rgb(85, 85, 85);">ZERØGRAND OVERTAKE GOLF WR</strong><span style="color: rgb(85, 85, 85);">&nbsp;đế hybrid mang phong cách sneaker sang trọng, tích hợp công nghệ&nbsp;</span><strong style="color: rgb(85, 85, 85);">GRANDFØAM&nbsp;</strong><span style="color: rgb(85, 85, 85);">mang đến sự thoải mái, linh hoạt cho gôn thủ suốt ngày dài. Mũ giày bằng vải lưới co giãn, ôm khít, vừa vặn với khuôn chân, mang lại cảm giác vừa vặn, thoải mái. Lớp da phía trong có khả năng chống thấm nước, giữ cho đôi chân người chơi luôn khô thoáng. Đế ngoài phú đinh hybrid hiệu suất cao, tạo độ bám chắc chắn cho từng chuyển động xoay người đánh bóng.</span></p><ul><li>Thiết kế tăng hiệu suất cho những cú xoay người đánh bóng</li><li>Kết cấu vải lưới co giãn, vừa vặn và lớp lót phía trong giữ cho đôi chân luôn khô thoáng</li><li>Đệm đế giữa GRANDFØAM êm ái, tạo cảm giác thoải mái cho gôn thủ ngay cuộc chơi kéo '),
	(16, 3, 5, 'Giày Sneaker Nữ Nike Gamma Force', '2024-02-22 14:28:06', '2024-03-27 13:30:10', NULL, NULL, b'1', '<p><strong style="color: rgb(27, 27, 27);">GIÀY THỜI TRANG NỮ NIKE GAMMA FORCE</strong></p><p><span style="color: rgb(27, 27, 27);">Sự kết hợp của phong cách và sự thoải mái được tích hợp trong đôi giày Nike Gramma Force. Gamma kết hợp da lộn với da thật và da tổng hợp để tạo nên một diện mạo mới cho phiên bản AF-1 cổ điển. Các điểm nhấn Nike Grind trên đế ngoài và một chiếc kẹp nhựa bóng ở phần gót tạo nên những chi tiết hiện đại để mang lại cho Gamma Force một màu sắc của riêng nó.</span></p><p><strong>THÔNG SỐ</strong></p><ul><li>Đệm xốp</li><li>Đế giày cao su</li><li>Các lớp da và lưới tăng thêm độ bền và giúp phù hợp với mọi trang phục</li><li>Phần đế được thiết kế tinh tế giúp tăng chiều cao cho bạn</li><li>Các điểm nhấn cao su của Nike Grind chứa ít nhất 5% thành phần tái chế</li><li>Mã sản phẩm: DX9176-102</li></ul><p><br></p>'),
	(17, 3, 2, 'Giày Sneaker Nam Nike Full Force Low', '2024-02-22 14:45:43', '2024-02-22 14:47:45', NULL, NULL, b'1', '<p><strong style="color: rgb(27, 27, 27);">GIÀY SNEAKER NAM NIKE FULL FORCE LOW - TRẮNG</strong></p><p><span style="color: rgb(27, 27, 27);">Nike Full Force Low đưa bạn trở về thời đại của những đôi giày sneakers đơn giản, mạnh mẽ, nơi chất lượng và phong cách vượt thời gian lên ngôi. Đây là một đôi giày hoàn hảo giúp bạn cảm nhận sự ôm chân êm ái, bùng nổ năng lượng trong từng bước di chuyển, và để dấu ấn cá tính trên mọi con đường.</span></p><p><strong>THÔNG SỐ</strong></p><ul><li>Phần trên bằng da thật cao cấp, mềm mại và bền bỉ</li><li>Đế giữa bằng foam êm ái, nâng niu từng bước chân</li><li>Đế ngoài cao su bền bỉ, bám sân tuyệt vời:</li><li>Mã sản phẩm: FB1362-101</li></ul>'),
	(18, 1, 5, 'Air Force 1’07 LX ‘Bling’', '2024-02-22 14:49:13', '2024-02-22 14:51:38', NULL, NULL, b'1', '<p><span style="background-color: transparent; color: rgb(0, 0, 0);">Giới thiệu chung:</span></p><p><span style="background-color: transparent; color: rgb(0, 0, 0);">&nbsp;&nbsp;Giày Nike Air Force 1 Low \'07 LX \'Bling\'&nbsp;là mẫu giày nằm trong dòng sản phẩm Nike Air Force 1 của thương hiệu nổi tiếng trong lĩnh vực trang phục thể thao. Thương hiệu này chính thức ra mắt dòng sản phẩm Nike Air Force 1 do nhà thiết kế Bruce Kilgore sáng chế vào năm 1982 và Nike Air Force 1 đã nhanh chóng tạo nên “cơn sốt” sau khi ra mắt. bắt đầu. Cho đến nay, Nike AF1 vẫn chưa có dấu hiệu “hạ nhiệt” và vẫn là sự lựa chọn hàng đầu của các tín đồ thời trang.&nbsp;</span></p><p><br></p><p><span style="background-color: transparent; color: rgb(0, 0, 0);">Thương hiệu: Nike</span></p><p><span style="background-color: transparent; color: rgb(0, 0, 0);">Mã sản phẩm: CZ8101 100</span></p><p><span style="background-color: transparent; color: rgb(0, 0, 0);">Giới tính: Unisex</span></p><p><span style="background-co'),
	(19, 5, 2, 'STAN SMITH', '2024-02-22 14:52:37', '2024-02-25 15:25:42', NULL, NULL, b'1', '<h2>Workout clothes, for any sport</h2><p>adidas designs for and with athletes of all kinds. Creators, who love to change the game. Challenge conventions. Break the rules and define new ones. Then break them again. We supply teams and individuals with athletic clothing pre-match. To stay focussed. We design sports apparel that get you to the finish line. To win the match. We support women, with bras and tights made for purpose. From low to high support. Maximum comfort. We design, innovate and itterate. Testing new technologies in action. On the pitch, the tracks, the court, the pool. Retro workout clothes inspire new streetwear essentials. Like NMD, Ozweego and our Firebird tracksuits. Classic sports models are brought back to life. Like Stan Smith. And Superstar. Now seen on the streets and the stages.</p><p><br></p><p>Through our collections we blur the borders between high fashion and high performance. Like our adidas by Stella McCartney athletic clothing collection – designed to</p>'),
	(21, 5, 5, 'Giày Sneaker Nữ Fila Court Deluxe Bold', '2024-02-25 16:38:07', '2024-03-04 12:20:32', NULL, NULL, b'1', '<p><strong style="color: rgb(27, 27, 27);">GIÀY SNEAKER NỮ FILA COURT DELUXE BOLD - TRẮNG</strong></p><p><span style="color: rgb(27, 27, 27);">Đưa phong cách thời trang của bạn lên một tầm cao mới với Giày Sneaker Nữ Fila Court Deluxe Bold. Sự kết hợp hoàn hảo giữa thiết kế cổ điển và chất liệu hiện đại, đôi giày này mang đến vẻ ngoài thanh lịch, dễ dàng chuyển đổi từ những buổi đi chơi thường ngày sang các hoạt động thể thao năng động.</span></p><p><span style="color: rgb(27, 27, 27);">"Court Deluxe" là biểu tượng lấy cảm hứng từ bộ môn tennis, nhấn mạnh triết lý độc đáo của FILA "SẠCH, ĐƠN GIẢN, ĐẲNG CẤP" và tái hiện xu hướng những năm 90. Với thiết kế tinh tế, đôi giày này dễ dàng phối hợp với nhiều trang phục, giúp bạn cảm nhận được tinh thần Fila.</span></p><p><strong>THÔNG SỐ</strong></p><ul><li>Thân giày: Da tổng hợp, 100% polyester</li><li>Lớp lót bên trong: 100% polyester</li><li>Đế ngoài: Cao su tổng hợp</li><li>Mã sản phẩm: 1XM02338G-920</li></ul>'),
	(22, 5, 2, 'Air Jordan 1 Low SE', '2024-02-25 16:45:56', '2024-03-17 09:36:46', NULL, NULL, b'1', '<p>xxv</p>'),
	(23, 5, 5, 'Giày Chạy Bộ Unisex Hoka Cielo X1', '2024-02-26 11:54:05', '2024-03-03 14:49:07', NULL, NULL, b'1', '<p><strong style="color: rgb(27, 27, 27);">GIÀY CHẠY BỘ UNISEX HOKA CIELO X1</strong></p><p><span style="color: rgb(27, 27, 27);">Trải nghiệm sự đột phá với Giày Chạy Bộ Unisex Hoka Cielo X1, sản phẩm mang đến hiệu suất tối ưu và độ bền không giới hạn cho những vận động viên chuyên nghiệp. Thiết kế đỉnh cao, chất liệu tiên tiến, đôi giày giúp bạn cảm nhận được sức mạnh và độ đàn hồi cần thiết để vượt qua mọi giới hạn.</span></p><p><strong>THÔNG SỐ</strong></p><ul><li>Lớp đế carbon dẻo dai, nhẹ nhàng</li><li>Đế giữa được làm từ foam nén chất lượng cao, mang lại sự thoải mái và hỗ trợ tối đa cho từng bước chạy</li><li>Công nghệ Meta-Rocker giúp bạn chuyển động mạnh mẽ, linh hoạt, tiết kiệm năng lượng, duy trì tốc độ đỉnh cao trong suốt cuộc đua.</li><li>Đế Pebax® 4 đinh giúp duy trì độ bám và ổn định trên mọi bề mặt đường đua</li><li>Chất liệu lưới kỹ thuật giúp tăng cường khả năng thoáng khí, giữ cho đôi chân luôn khô ráo trong mọi thời tiết</li><li>Mã sản phẩm: 1147910-ENN</li></ul>');
